    t[1514] = "With this tunnel type, IRC networks in I2P can be reached by typing the I2P address into your IRC client, and configuring the IRC client to use this SOCKS tunnel.";
    t[1515] = "Bu t\u00fcnel t\u00fcr\u00fcyle, I2P adresini IRC istemcinize yazarak ve IRC istemcisini bu SOCKS t\u00fcnelini kullanacak \u015fekilde yap\u0131land\u0131rarak I2P'deki IRC a\u011flar\u0131na ula\u015f\u0131labilir.Bu t\u00fcnel t\u00fcr\u00fcyle, IRC istemcisi bu SOCKS t\u00fcnelini kullanacak \u015fekilde ayarlanarak ve I2P adresi IRC istemcisine yaz\u0131larak I2P i\u00e7indeki IRC a\u011flar\u0131na eri\u015filebilir.";
    t[1520] = "When enabled, the accept headers (mime types support) broadcast by your web browser will not be filtered, potentially reducing your anonymity";
    t[1521] = "Etkinle\u015ftirildi\u011finde, web taray\u0131c\u0131n\u0131z taraf\u0131ndan yay\u0131nlanan kabul \u00fcstbilgileri (mime t\u00fcrleri deste\u011fi) filtrelenmeyecek, bu da potansiyel olarak anonimli\u011finizi azaltacakt\u0131r.Bu se\u00e7enek etkinle\u015ftirildi\u011finde, web taray\u0131c\u0131n\u0131z taraf\u0131ndan yay\u0131nlanan onaylama \u00fcst bilgileri (mime t\u00fcrleri deste\u011fi) s\u00fcz\u00fclmez, ancak bu durum anonimli\u011finizi azalt\u0131r";
    t[1532] = "When enabled, the referer (originating page) of your web requests will not be filtered, potentially reducing your anonymity";
